import React from 'react'

const InputCurrency = (props) => {
  return (
    <div>
        <input type="number" value={props.currencyQuantity}/>
        <select name="currency" id="currency">{props.currencySlash.map(currency =>{
            <option value={currency} key={currency}>{currency}</option>
        })}</select>
    </div>
  )
}

export default InputCurrency
